import Head from "next/head";

import Header from "./components/Header.js";
// import "./index.css";

const Index = () => (
  <div>
    <Head>
      <title>My styled page</title>
      <link href="/pages/styles.css" rel="stylesheet" />
    </Head>
    <Body>
      <div>
        <div>Hello</div>
        <Header />
      </div>
    </Body>
  </div>
);

export default Index;
